Mongoose: Using custom function to convert value in query / aggregation<p>My collection of products looks like this:</p>

<pre><code>[{
  _id: '1',
  name: 'Car'
  price: {
    currency: 'EUR',
    value: 1200
  }
}, {
  _id: '2',
  name: 'TV'
  price: {
    currency: 'GBP',
    value: 150
  }
}, {
  _id: '3',
  name: 'Phone'
  price: {
    currency: 'USD',
    value: 240
  }
}]
</code></pre>

<p>Now, someone sends request to my backend to display all products with prices between 10 and 500 PLN. My idea is to get current exchange rates for base currency PLN, calculate the edge prices (10 and 500) on each iteration for every product's currency and see if the price is within the calculated range. The problem is that I cannot construct a proper query. I tried like this:</p>

<pre><code>const query = [
    ...(req.query.priceFrom ? [{ "price.value": { "$gte": getCalculatedRange(req.query.priceFrom, '$price.currency') }}] : []),
    ...(req.query.priceTo ? [{ "price.value": {"$lte": getCalculatedRange(req.query.priceTo, '$price.currency') }}] : [])
];

const products = await Product.find({ $and: query });
</code></pre>

<p>As you can see I want to get correct ranges for current iterated product price, but the problem is that it's not possible (or maybe possible?) to pass values from current iteration (in my case: currency)  to function in order to get converted value. The text '$price.currency' is passed to the function instead of real value from the object (I know that's obvious and stupid from my side, but I want to illustrate it thoroughly and clear what I struggle with). </p>

<p>Is there a way to make it work?</p>

