Mongoose: TypeError: 'mongooseSchemahere' is not a function<p>I have the following mongoose Schema setup in models/user.js:</p>

<pre><code>const mongoose = require('mongoose');

const userSchema = mongoose.Schema({

    loginId: String,
    firstname: String,
    lastname: String,
    eMail: String,
    password: String,
    active: Boolean

});

module.exports = userSchema; 
</code></pre>

<p>In my main app.js I have the following code:</p>

<pre><code>const mongoose = require('mongoose');
var MongoClient = require('mongodb').MongoClient;
var url = "mongodb://localhost:27017/";

MongoClient.connect(url,  {
  useUnifiedTopology: true,
  useNewUrlParser: true,
  },function(err, db) {
  if (err) throw err;
  var dbo = db.db("db");
  dbo.collection("db").find({}).toArray(function(err, result) {
    if (err) throw err;
    console.log(result);
    db.close();
  });
}); 

let userSchema = require('./models/user.js');
// Get single user
app.get('/user/:id', function (req, res) {
  userSchema.findById(req.params.id, (error, data) =&gt; {
    if (error) {
      return next(error)
    } else {
      res.json(data)
    }
  })
})
</code></pre>

<p>I get the error which is in the title (just replace mongooseSchemahere with userSchema). What did I do wrong? I tried putting the userSchema declaration in different places, it did not help..</p>

