Is there a way to filter embedded arrays in mongodb?<p>I have a collection like this</p>

<pre><code>[
{
    "_id" : {
        "id" : 1
    },
    "group" : [ 
        {
            "id" : 1,
            "users" : [ 
                {
                    "id" : 3000,
                    "active" : true,
                }, 
                {
                    "id" : 3001,
                    "active" : false,
                }
            ]
        },
    ]
},
{
    "_id" : {
        "id" : 2
    },
    "group" : [ 
        {
            "id" : 2,
            "users" : [ 
                {
                    "id" : 4000,
                    "active" : true,
                }, 
                {
                    "id" : 4001,
                    "active" : false,
                }
            ]
        },
    ]
}
]
</code></pre>

<p>I would like to project all collection, but just the users with active equals to true. Like this:</p>

<pre><code>[
{
    "_id" : {
        "id" : 1
    },
    "group" : [ 
        {
            "id" : 1,
            "users" : [ 
                {
                    "id" : 3000,
                    "active" : true,
                }, 
            ]
        },
    ]
},
{
    "_id" : {
        "id" : 2
    },
    "group" : [ 
        {
            "id" : 2,
            "users" : [ 
                {
                    "id" : 4000,
                    "active" : true,
                }, 
            ]
        },
    ]
}
]
</code></pre>

<p>I tried to use this to bring the result, but doesn't work.</p>

<pre><code>{
        $project: {

            '_id': 1,
            'groups': {
                 $filter: {
                    input: '$group',
                    as: 'g',
                    cond: {
                        $and: [
                            { '$eq': ['$$g.users.active', true] }
                        ],
                    },
                },
            }
        }
}
</code></pre>

<p>If i just use <code>{ '$eq': ['$$g.id', 1] }</code>, it works but when i try to use the third level, this doesn't work.</p>

<p>Is there some way to access the third level and make a filter with the values? I searched in mongodb documentation but i didn't find anything.</p>

<p>Does anyone have any solution?</p>

